import React from "react";

function SmallControls() {
	return (
		<div className="Acca-Small-Controls">
            <input
                className="Acca-Controls-Small"
                name="backStake"
                value={this.state.backStake}
                onChange={this.handleInputChange}
            />
            <input
                className="Acca-Controls-Small"
                name="totalBackOdds"
                value={this.state.totalBackOdds}
                onChange={this.handleInputChange}
            />
        </div>
	)
}

export default SmallControls;
